import React, { Component } from "react";
import Layout from "../../components/Layout";
import Game from "../../components/Game";
import Head from "next/head";
import Unity, { UnityContent } from "react-unity-webgl";

class Theresume extends Component{
    constructor(props) {
        super(props);
        this.unityContent = new UnityContent(
          "MyGame/Build/Game.json",
          "MyGame/Build/UnityLoader.js"
        );
      }
      onClick() {
        this.unityContent.send(
          "SpawnController", 
          "SpawnEnemies", 
          10
        );
      }
    render(){
        return(
            <Layout>
            
            <Head>
            <script src="MyGame/TemplateData/UnityProgress.js"></script>
            <script src="MyGame/Build/UnityLoader.js"></script>
            <script>
                UnityLoader.instantiate("unityContainer", "Build/Game.json");
            </script>
            </Head>
                <div className="container">
                    <div className="row d-flex justify-content-center">
                        <h1>The Resume Game</h1>
                        <div className="container bg-dark">
        <button className="text-right" onClick={this.onClick.bind(this)}>Start!</button>
        <Unity unityContent={this.unityContent} />
      </div>
                    </div>
                </div>                 
            </Layout>               
        )
    }
}

export default Theresume;
